import React, { Component } from "react";
import AOS from "aos";

export default class Title extends Component {
  componentDidMount() {
    AOS.init();
  }

  render() {
    return (
      <div id="">
        <h1 className="titleName">Charlotte Mountain</h1>
        <h3 className="titleJob">WEB DEVELOPER</h3>
      </div>
    );
  }
}
